Belles De Reve (J. Helbie / Video Marc Dorcel / Classic / 1983) 

A flood of sexual aggressions is widely talked out. The police finds out that all the victims are young and pretty girls who all had been patients of Doctor Corte. This distinguished analyst had set up a therapy for brain sexual stimulations.

Catherine Belin, Christine Glenne, Eva Kleber, E. Lang, Cathy Menard, Gabriel Pontello

Classic

